        public static void InsertTestCustomers()
        {
            List<Customer>? customers = default;
            Customer? c = default;


            List<string> firstnamesWithGender = GetFirstnames();
            List<string> lastnames = GetLastnames();

            //Default Customers



            customers = new List<Customer>()
            {
                  new Customer("tina@test.de", Customer.GetHash("test" + "tina@test.de"), "Tina", "Test",   Gender.female, Adress.Get(1)),
                  new Customer("toni@test.de", Customer.GetHash("test" + "toni@test.de"), "Toni", "Testus", Gender.male, Adress.Get(2)),
                  new Customer("tristian@test.de", Customer.GetHash("test" + "tristian@test.de"), "Tristian",  "Tandel", Gender.divers, Adress.Get(2)),
            };

            customers.ForEach(item => item.Insert()); // instent insert to gain performance

            // Random Customer

            while (customers.Count < countTestCases)
            {
                string[] firstnameWithGender = firstnamesWithGender[r.Next(firstnamesWithGender.Count)].Split(';');

                string firstname = firstnameWithGender[0];
                Gender gender = (Gender)Enum.Parse(typeof(Gender), firstnameWithGender[1]);
                string lastname = lastnames[r.Next(lastnames.Count)].Trim();
                string email = $"{firstname.ToLower()}.{lastname[0].ToString().ToLower()}@random.de";

                c = new Customer(email, Customer.GetHash("test" + email), firstname, lastname, gender, Adress.Get(r.Next(1, countTestCases)));

                if (customers.Find(item => item.EMail == c.EMail) == null)
                {
                    customers.Add(c);
                    c.Insert();
                }
            }
        }
