        public static void InsertOrders()
        {
            List<Position> pos = new List<Position>();
            List<Order> o = new List<Order>();
            List<Status> stati = Enum.GetValues<Status>().ToList();

            // Get Random Positions for all other Customer

            foreach (Customer item in Customer.GetAll())
            {
                for (int i = 0; i < r.Next(1, 3); i++)
                {
                    pos = new List<Position>();

                    for (int t = 0; t < r.Next(1, 4); t++)
                    {
                        pos.Add(new Position(r.Next(1, 31), Article.Get(r.Next(1, 11)))); // Article 1 - 10 so because if taken all delete Article cant be show because Database constraint

                        if (item.Id == 1) // More Positions for Tina Test
                        {
                            pos.Add(new Position(r.Next(1, 31), Article.Get(r.Next(1, 11)))); // Article 1 - 10 so because if taken all delete Article cant be show because Database constraint
                            pos.Add(new Position(r.Next(1, 31), Article.Get(r.Next(1, 11)))); // Article 1 - 10 so because if taken all delete Article cant be show because Database constraint
                            pos.Add(new Position(r.Next(1, 31), Article.Get(r.Next(1, 11)))); // Article 1 - 10 so because if taken all delete Article cant be show because Database constraint
                            pos.Add(new Position(r.Next(1, 31), Article.Get(r.Next(1, 11)))); // Article 1 - 10 so because if taken all delete Article cant be show because Database constraint
                        }
                    }

                    if (i == 0)
                        new Order(item, Status.Warenkorb, pos).Insert();
                    new Order(item, stati[r.Next(2, stati.Count)], pos).Insert();
                    GC.Collect();
                }
            }

            // Get Random Position for all NonCustomer

            foreach (NonCustomer item in NonCustomer.GetAll())
            {
                for (int i = 0; i < r.Next(1, 3); i++)
                {
                    pos = new List<Position>();

                    for (int t = 0; t < r.Next(1, 3); t++)
                    {
                        pos.Add(new Position(r.Next(1, 31), Article.Get(r.Next(1, 11)))); // Article 1 - 10 so because if taken all delete Article cant be show because Database constraint
                    }

                    new Order(item, stati[r.Next(2, stati.Count)], pos).Insert();
                    GC.Collect();
                }
            }

        }
        public static void InsertPictures()
        {
            List<Article> al = Article.GetAll();
            List<byte[]> data = GetPicturesData();

            if (al != null && data != null)
            {

                // Article and Pictures must match! Start at 1
                for (int i = 0; i < data.Count; i++)
                {
                    if (i == 0)
                    {
                        (new Picture($"logo.jpg", data[i])).Insert();
                    }
                    else
                    {
                        string? name = al != null && al[i] != null && al[i].Name != null ? al[i].Name : "";
                        (new Picture($"{(name != null ? name.Replace(' ', '_').Replace(',', '_') : "noname")}.jpg", data[i], Article.Get(i))).Insert();
                    }

                }

                // For all other article question mark
                if (al != null)
                {
                    for (int i = data.Count - 1; i < al.Count; i++)
                    {
                        string? name = al != null && al[i] != null && al[i].Name != null ? al[i].Name : "";
                        (new Picture($"{(name != null ? name.Replace(' ', '_').Replace(',', '_') : "noname")}.jpg", data[data.Count - 1], Article.Get(i + 1))).Insert();
                    }
                }
            }

        }
